package go_2025_03

func countOfSubstrings(word string, k int) int64 {

	count_k := atLeastKLengthSubstrings(word, k)
	count_k1 := atLeastKLengthSubstrings(word, k+1)

	return count_k - count_k1
}

// 判断字符是否为元音字母
func isVowel(ch byte) bool {
	return ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u'
}

func atLeastKLengthSubstrings(word string, k int) int64 {
	// 滑窗内辅音字母个数
	consonants := 0
	// 滑窗内元音字母 set
	vowels_set := make(map[byte]int)
	// 辅音字母个数至少为 k 的子串个数
	var count_k int64 = 0
	// 先计算满足条件，辅音字母至少为 k 的子串个数
	// 指定滑窗左右下标
	left, right := 0, 0
	for left < len(word) {
		// 当元音字母全部出现且辅音字母个数大于等于 k 时，满足条件
		if len(vowels_set) == 5 && consonants >= k {
			// 此时，左边界为滑窗左侧、右边界大于等于滑窗右侧的所有子串均满足条件
			count_k += int64(len(word) - right + 1)
			if isVowel(word[left]) {
				vowels_set[word[left]] = vowels_set[word[left]] - 1
				if vowels_set[word[left]] == 0 {
					delete(vowels_set, word[left])
				}
			} else {
				consonants--
			}
			// fmt.Println(string(word[left]))
			left++
		} else {
			if right < len(word) {
				// fmt.Println(word[left : right+1])

				if isVowel(word[right]) {
					if cnt, exists := vowels_set[word[right]]; exists {
						vowels_set[word[right]] = cnt + 1
					} else {
						vowels_set[word[right]] = 1
					}
				} else {
					consonants++
				}
			} else {
				// 后续不可能再有满足条件的子串
				break
			}
			right++
		}
	}
	return count_k
}

func TestCountOfSubstrings() {
	println(countOfSubstrings("aeioqq", 1))
	println(countOfSubstrings("aeiou", 0))
	println(countOfSubstrings("ieaouqqieaouqq", 1))
	println(countOfSubstrings("", 63423))
}
